import React from "react";

import './navbar.css';

const Navbar = () => {
    return (
        <div className='navbar'>
            <p className="navbar__title">Содержание статьи:</p>
            <ol className="navbar_list">
                <li>Опасность остеопороза</li>
                <li>Группа и факторы риска</li>
                <li>Симптомы и проявления</li>
                <li>Типы остеопороза</li>
                <li>Диагностика</li>
                <li>Профилактика и лечение</li>
                <li>Препараты</li>
                <li>Побочные эффекты и их устранение</li>
                <li>Золедронаты</li>
                <li>Дозировка</li>
                <li>Эффективность</li>
                <li>Длительность лечения</li>
                <li>Удобство использования</li>
            </ol>
        </div>
    )
};

export default Navbar;
